import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import MainPage from "./pages/MainPage";
import SignUpPage from "./pages/SignUpPage";
import SignInPage from "./pages/SignInPage";
import SignOutPage from "./pages/SignOutPage";
import RoomPage from "./pages/GatherRoomPage";
import MyPage from "./pages/MyPage";
import UserListPage from "./pages/UserListPage";
import UserDetailPage from "./pages/UserDetailPage";
import Header from "./components/Header";
import Footer from "./components/Footer";
import NoticeListPage from "./pages/NoticeListPage";
import CreateNoticePage from "./pages/CreateNoticePage";
import UpdateNoticePage from "./pages/UpdateNoticePage";
import NoticeDetailPage from "./pages/NoticeDetailPage";
import FindPasswordPage from "./pages/FindPasswordPage";
import ChangePasswordPage from "./pages/ChangePasswordPage";
import WelcomeMessagePage from "./pages/WelcomeMessagePage";
import PageNotFoundPage from "./pages/PageNotFoundPage";
import EmailAuthPage from "./pages/EmailAuthPage";

// import VideoRoomPage from "./pages/VideoRoomPage";
// import GameRoomPage from "./pages/GameRoomPage";

// import RoomListPage from "./pages/RoomListPage";

import React from "react";
import { useSelector } from "react-redux";
import { Navigate } from "react-router-dom";
import "./App.css";
import "./color.css";

function App() {
    
    const token = useSelector(state => state.user.accessToken);
    const userSeq = useSelector(state => state.user.userSeq) ? true : false;
    const auth = useSelector(state => state.user.auth);
    const isAdmin = useSelector(state => state.user.isAdmin) === 'ROLE_ADMIN' ? true : false;

    return (
        <div className="App">
            <Router>
                <Header/>
                <Routes>
                    <Route exact path="/" element={token && (userSeq && !auth) ? <Navigate to="/emailauth" /> : <MainPage />} />
                    <Route exact path="/signup" element={<SignUpPage />} />
                    <Route exact path="/signin" element={token ? <Navigate to="/" /> : <SignInPage />} />
                    <Route exact path="/signout" element={<SignOutPage />} />
                    <Route exact path="/emailauth" element={<EmailAuthPage />} />
                    <Route exact path="/mypage" element={<MyPage />} />
                    <Route exact path="/userlist" element={isAdmin ? <UserListPage /> : <Navigate to="/" />} />
                    <Route exact path="/board" element={token ? <NoticeListPage /> : <Navigate to="/" />} />
                    <Route exact path="/gatherroom" element={token ? <RoomPage /> : <Navigate to="/" />} />
                    <Route exact path="/board/create" element={isAdmin ? <CreateNoticePage /> : <Navigate to="/" />} />
                    <Route exact path="/board/:noticeId" element={token ? <NoticeDetailPage /> : <Navigate to="/" />} />
                    <Route exact path="/board/:noticeId/update" element={isAdmin ? <UpdateNoticePage /> : <Navigate to="/" />} />
                    <Route exact path="/findpassword" element={token ? <FindPasswordPage /> : <Navigate to="/" />} />
                    <Route exact path="/changepassword" element={token ? <ChangePasswordPage /> : <Navigate to="/" />} />
                    <Route exact path="/welcome" element={<WelcomeMessagePage />} />
                    <Route exact path="/users" element={isAdmin ? <UserListPage /> : <Navigate to="/" />} />
                    <Route exact path="/users/:userId" element={isAdmin ? <UserDetailPage /> : <Navigate to="/" />} />
                    <Route exact path="/*" element={<PageNotFoundPage />} />
                </Routes>
                <Footer />
            </Router>
        </div>
    );
}

export default App;
